(6, 1, '2021-09-23 13:32:44', '2021-09-23 13:32:44', '<!-- wp:paragraph -->\n<p>You might be an artist who would like to introduce yourself and your work here or maybe you’re a business with a mission to describe.</p>\n<!-- /wp:paragraph -->', 'О нас', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2021-09-23 13:57:11', '2021-09-23 13:57:11', '', 0, 'http://otzovik/?page_id=6', 0, 'page', '', 0),
(7, 1, '2021-09-23 13:32:44', '2021-09-23 13:32:44', '<!-- wp:paragraph -->\n<p>This is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.</p>\n<!-- /wp:paragraph -->', 'Contact', '', 'trash', 'closed', 'closed', '', 'contact__trashed', '', '', '2021-09-23 14:00:08', '2021-09-23 14:00:08', '', 0, 'http://otzovik/?page_id=7', 0, 'page', '', 0),
